import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms'; // Import FormsModule

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DateCalculatorComponent } from './date-calculator/date-calculator.component'; // Make sure to import your DateCalculatorComponent

@NgModule({
  declarations: [
    AppComponent,
    DateCalculatorComponent, // Add your component here
  ],
  imports: [
    BrowserModule,
    FormsModule, // Add FormsModule to your imports
    AppRoutingModule,
  ],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule { }
